import React from 'react';
import { useNavigate } from 'react-router-dom';

function AdminDashboard() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Ici tu peux aussi supprimer token dans localStorage ou autre si tu enregistres le token
    // localStorage.removeItem('token');
    navigate('/login'); // Redirection vers login après déconnexion
  };

  return (
    <div style={{ padding: 20 }}>
      <h1>Dashboard Admin</h1>
      <p>Bienvenue sur la page admin.</p>
      <div style={{ marginTop: 20 }}>
        <h2>Gestion des Travailleurs</h2>
        
        {/* Formulaire d'ajout de travailleur */}
        <div style={{ marginBottom: 30, padding: 20, border: '1px solid #ddd', borderRadius: 8 }}>
          <h3>Ajouter un Travailleur</h3>
          <form onSubmit={handleAddWorker}>
            <input
              type="text"
              placeholder="Nom d'utilisateur"
              value={newWorker.username}
              onChange={(e) => setNewWorker({...newWorker, username: e.target.value})}
              style={{ margin: '5px', padding: '8px', borderRadius: 4 }}
              required
            />
            <input
              type="password"
              placeholder="Mot de passe"
              value={newWorker.password}
              onChange={(e) => setNewWorker({...newWorker, password: e.target.value})}
              style={{ margin: '5px', padding: '8px', borderRadius: 4 }}
              required
            />
            <select
              value={newWorker.role}
              onChange={(e) => setNewWorker({...newWorker, role: e.target.value})}
              style={{ margin: '5px', padding: '8px', borderRadius: 4 }}
            >
              <option value="user">Utilisateur</option>
              <option value="admin">Administrateur</option>
            </select>
            <button type="submit" style={{ margin: '5px', padding: '8px 16px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: 4, cursor: 'pointer' }}>
              Ajouter
            </button>
          </form>
        </div>

        {/* Liste des travailleurs */}
        <div style={{ marginBottom: 30 }}>
          <h3>Liste des Travailleurs</h3>
          <div style={{ display: 'grid', gap: '10px' }}>
            {workers.map((worker) => (
              <div key={worker.id} style={{ padding: 15, border: '1px solid #ddd', borderRadius: 8, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <div>
                  <strong>{worker.username}</strong> - {worker.role}
                </div>
                <div>
                  <button
                    onClick={() => handleEditWorker(worker)}
                    style={{ marginRight: '10px', padding: '5px 10px', backgroundColor: '#ffc107', color: 'black', border: 'none', borderRadius: 4, cursor: 'pointer' }}
                  >
                    Modifier
                  </button>
                  <button
                    onClick={() => handleDeleteWorker(worker.id)}
                    style={{ padding: '5px 10px', backgroundColor: '#dc3545', color: 'white', border: 'none', borderRadius: 4, cursor: 'pointer' }}
                  >
                    Supprimer
                  </button>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Modal de modification */}
        {editingWorker && (
          <div style={{ position: 'fixed', top: 0, left: 0, right: 0, bottom: 0, backgroundColor: 'rgba(0,0,0,0.5)', display: 'flex', justifyContent: 'center', alignItems: 'center', zIndex: 1000 }}>
            <div style={{ backgroundColor: 'white', padding: 20, borderRadius: 8, minWidth: 300 }}>
              <h3>Modifier le Travailleur</h3>
              <form onSubmit={handleUpdateWorker}>
                <input
                  type="text"
                  placeholder="Nom d'utilisateur"
                  value={editingWorker.username}
                  onChange={(e) => setEditingWorker({...editingWorker, username: e.target.value})}
                  style={{ width: '100%', margin: '5px 0', padding: '8px', borderRadius: 4 }}
                  required
                />
                <input
                  type="password"
                  placeholder="Nouveau mot de passe (laisser vide si inchangé)"
                  onChange={(e) => setEditingWorker({...editingWorker, password: e.target.value})}
                  style={{ width: '100%', margin: '5px 0', padding: '8px', borderRadius: 4 }}
                />
                <select
                  value={editingWorker.role}
                  onChange={(e) => setEditingWorker({...editingWorker, role: e.target.value})}
                  style={{ width: '100%', margin: '5px 0', padding: '8px', borderRadius: 4 }}
                >
                  <option value="user">Utilisateur</option>
                  <option value="admin">Administrateur</option>
                </select>
                <div style={{ marginTop: 15 }}>
                  <button type="submit" style={{ marginRight: '10px', padding: '8px 16px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: 4, cursor: 'pointer' }}>
                    Sauvegarder
                  </button>
                  <button type="button" onClick={() => setEditingWorker(null)} style={{ padding: '8px 16px', backgroundColor: '#6c757d', color: 'white', border: 'none', borderRadius: 4, cursor: 'pointer' }}>
                    Annuler
                  </button>
                </div>
              </form>
            </div>
          </div>
        )}

        <button 
          onClick={handleLogout} 
          style={{
            marginTop: 20,
            padding: '10px 20px',
            backgroundColor: '#7f53ac',
            color: 'white',
            border: 'none',
            borderRadius: 6,
            cursor: 'pointer',
            fontWeight: 'bold'
          }}
        >
          Déconnexion
        </button>
      </div>
    </div>
  );
}

export default AdminDashboard;
